0,task_bookend,,user,Start,,off,off,Time Perception,"<p>This study is investigation how people's perception of the passing of time changes within a situation.
<br><br>
Within the next task, you will initially see a cross in the centre of the screen to direct your gaze. The cross will be replaced by either a written word, a spoken word, or both togehter. Once the initial word(s) have appeared, a straight line will appear on the screen and a constant audio tone will play. This tone will last for either 1.5 seconds (a long period) or 0.5 seconds (a short period). The tone will only be one of these two options. When the tone ends, the word(s) you saw/heard will be repeated. After that repetition, you will be presented with two response buttons.
<br><br>
<b>All you have to do is state whether the audio tone you heard lasted for a long (1.5 seconds) or short (0.5 seconds) period of time.</b>
<br><br>
To hear each tone before you start, please click the button below.<br><br>
<button id=""response_short"" class=""btn btn-outline-primary btn-sm me-3"">Short</button>
<button id=""response_long"" class=""btn btn-outline-primary btn-sm"">Long</button>
<br><br>
You will first complete a number of training trials designed to teach you the difference between a long and short audio tone. These trials do not include swear words.
<br><br>
When you are ready to start, please press 'Start' below.</p>
<script>
  $(document).ready(function() {
    // Define the audio source.
    var audioSrc = ""../../collector-experiments/User/Assets/timeperception/audio/200.mp3"";
    
    // Preload the audio by creating a template audio element.
    var audioTemplate = new Audio(audioSrc);
    audioTemplate.preload = ""auto"";
    audioTemplate.load();
    
    // When the ""Short"" button is clicked, play the audio for 400ms.
    $(""#response_short"").on(""click"", function() {
      // Clone the preloaded audio element so that it's ready to play immediately.
      var audio = audioTemplate.cloneNode(true);
      audio.play();
      setTimeout(function() {
        audio.pause();
        audio.currentTime = 0;
      }, 400);
    });
    
    // When the ""Long"" button is clicked, play the audio for 1600ms.
    $(""#response_long"").on(""click"", function() {
      var audio = audioTemplate.cloneNode(true);
      audio.play();
      setTimeout(function() {
        audio.pause();
        audio.currentTime = 0;
      }, 1600);
    });
  });
</script>",,
