0,task_bookend,,user,Start,,off,off,End of training trials,"<p>You are about to start the main experimental trials which do include swear words.
<br><br>
<b>These trials work in the same way as the training trials you have just completed. However, the audio tone now differs in length.
<br> 

<br><br>
Rather than deciding whether the audio tone played between the pair of words you see/hear was 'long' or 'short' in duration, you now must decide if the audio tone was closer to the 'long' or to the 'short' tone you heard during the previous training phase. If you think it was closer to the 0.5 second 'short' tone, click the 'Short' button or if you think it was closer to the 1.5 seconds 'long' tone, click the 'Long' button.</b>
<br><br>
As a reminder: you will initially see a cross in the centre of the screen (which you should focus on). The cross may be replaced by a written word and/or you may hear another word read out. After this, a horizontal line will appear and a single audio tone will play. When the tone ends, any initial written or spoken words will be repeated. You will then be given the two response buttons (short and long).
<br><br>
The task is broken up into several blocks and you will be given a break between blocks. When you are ready to start the experimental trials, please click 'Start' below.
</p>",,
